import React from "react";

export default function Meaning(props) {
  (props.meaning.definitions.map(function(definition, index){
      return(
          <div key={index}>
              {definition.definition}
              {definition.example}
          </div>
      )
  }));
  return (
    <div className="Meaning">
      <p>{props.meaning.partOfSpeech}</p>
    </div>
  );
}
